import React from 'react';
import {getData,codes} from '../data/workers';
import { Link,Outlet } from "react-router-dom";
export const WorkersList=()=>{
    let jCodes=codes;
    const changeCodes=()=>{
      jCodes=codes.filter((c)=>getData(c).address==='jerusalem');
    }
    return(<div>
      <button onClick={()=>changeCodes()}>only workers from jerusalem</button>
        <ul>
        {jCodes.map((w) => (
          <li key={w.id}>
            {" "}
            <Link to={`/WorkersList/${w}`}> {getData(w).name} </Link>{" "}
          </li>
        ))}
      </ul>
      <Outlet />
    </div>)
}
